    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>
    <style type="text/css">a, a > code {
color: rgb(249, 38, 114);
text-decoration: none;
}
.footnote {
position: absolute;
bottom: 3em;
padding-right: 4em;
font-size: 90%;
}
.remark-code-line-highlighted { background-color: #ffff88; }
.inverse {
background-color: #272822;
color: #d6d6d6;
text-shadow: 0 0 20px #333;
}
.inverse h1, .inverse h2, .inverse h3 {
color: #f3f3f3;
}

.left-column {
color: #777;
width: 20%;
height: 92%;
float: left;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #000;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px lightgray;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th { border-bottom: 1px solid #ddd; }
th, td { padding: 5px; }
.remark-slide thead, .remark-slide tfoot, .remark-slide tr:nth-child(even) { background: #eee }
@page { margin: 0; }
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}
</style>

.shareagain-bar {

bottom: 0;
left: 0;
right: 0;
height: 66px;
z-index: 1000;
}
.shareagain-bar ul {

}

    <script>/* global slideshow,ClipboardJS */
(function () {
  function inIframe () {
    try {
      return window.self !== window.top &&
        !window.self.location.href.match('viewer_pane=1') // in RStudio
    } catch (e) {
      return true
    }
  }

  if (!inIframe()) return

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(addShareAgainBar)

  function addShareAgainBar () {
    const icons = {
      left: '<svg fill="none" viewBox="0 0 24 24" stroke="currentColor" class="arrow-left w-6 h-6"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M10 19l-7-7m0 0l7-7m-7 7h18"></path></svg>',
      right: '<svg fill="none" viewBox="0 0 24 24" stroke="currentColor" class="arrow-right w-6 h-6"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M14 5l7 7m0 0l-7 7m7-7H3"></path></svg>',
      fullScreen: '<svg fill="none" viewBox="0 0 24 24" stroke="currentColor" class="arrows-expand w-6 h-6"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M4 8V4m0 0h4M4 4l5 5m11-1V4m0 0h-4m4 0l-5 5M4 16v4m0 0h4m-4 0l5-5m11 5l-5-5m5 5v-4m0 4h-4"></path></svg>',
      share: '<svg fill="none" viewBox="0 0 24 24" stroke="currentColor" class="share w-6 h-6"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M8.684 13.342C8.886 12.938 9 12.482 9 12c0-.482-.114-.938-.316-1.342m0 2.684a3 3 0 110-2.684m0 2.684l6.632 3.316m-6.632-6l6.632-3.316m0 0a3 3 0 105.367-2.684 3 3 0 00-5.367 2.684zm0 9.316a3 3 0 105.368 2.684 3 3 0 00-5.368-2.684z"></path></svg>'
    }

    function getAuthor () {
      let author = document.head.querySelector('meta[name="author"]')

      if (author) {
        author = author.content + ' — '
      } else {
        author = ''
      }
      return author
    }

    function truncate (str, n, useWordBoundary = true) {
      if (str.length <= n) { return str }
      const subString = str.substr(0, n - 1)
      return (useWordBoundary
        ? subString.substr(0, subString.lastIndexOf(' '))
        : subString) + '&hellip;'
    };

    function getShortTitle () {
      return truncate(window.document.title || '', 50)
    }

    const navbar = document.createElement('nav')
    navbar.classList.add('shareagain-bar')

    navbar.innerHTML += `<ul class="slideInUp">
    <li class="shareagain-buttons">
      <button type="button" class="shareagain-button" id="shareagain-slide-prev" title="Next Slide">${icons.left}</button>
      <button type="button" class="shareagain-button" id="shareagain-slide-next" title="Previous Slide">${icons.right}</button>
    </li>
    <li class="shareagain-title" title="${getAuthor()}${window.document.title || ''}">${getShortTitle()}</li>
    <li class="shareagain-buttons">
      <button type="button" class="shareagain-button" id="shareagain-fullscreen" title="View in Full Screen">${icons.fullScreen}</button>
      <button type="button" class="shareagain-button" id="shareagain-share" title="Share">${icons.share}</button>
      <div class="shareon">
        <button class="link" href="${document.URL}" title="Copy Direct Link" data-clipboard-text="${document.URL}"></button>
        <a class="twitter" title="Share on Twitter"></a>
        <a class="facebook" title="Share on Facebook"></a>
        <a class="linkedin" title="Share on Linkedin"></a>
        <a class="pinterest" title="Share on Pinterest"></a>
        <a class="pocket" title="Save to Pocket"></a>
        <a class="reddit" title="Share on Reddit"></a>
      </div>
    </li>
    </ul>`

    const slidesContainer = document.querySelector(':not(html).remark-container')
    slidesContainer.appendChild(navbar)

    const btnSlidePrev = document.getElementById('shareagain-slide-prev')
    const btnSlideNext = document.getElementById('shareagain-slide-next')

    function toggleSlideButtons (slideIndex) {
      if (typeof slideIndex === 'undefined') {
        slideIndex = slideshow.getCurrentSlideIndex()
      }

      // Toggle next slide button
      if (slideIndex + 1 === slideshow.getSlideCount()) {
        btnSlideNext.classList.add('disabled')
        btnSlideNext.setAttribute('disabled', true)
      } else {
        btnSlideNext.classList.remove('disabled')
        btnSlideNext.removeAttribute('disabled')
      }

      // Toggle prev slide button
      if (slideIndex === 0) {
        btnSlidePrev.classList.add('disabled')
        btnSlidePrev.setAttribute('disabled', true)
      } else {
        btnSlidePrev.classList.remove('disabled')
        btnSlidePrev.removeAttribute('disabled')
      }
    }

    setTimeout(toggleSlideButtons, 100)

    // button click events
    btnSlidePrev.addEventListener('click', function (ev) {
      slideshow.gotoPreviousSlide()
    })

    btnSlideNext.addEventListener('click', function (ev) {
      slideshow.gotoNextSlide()
    })

    // button touch events (block remarkjs slide change on touch)
    btnSlidePrev.addEventListener('touchend', function (ev) {
      ev.preventDefault()
      slideshow.gotoPreviousSlide()
      ev.stopPropagation()
    })

    btnSlideNext.addEventListener('touchend', function (ev) {
      ev.preventDefault()
      slideshow.gotoNextSlide()
      ev.stopPropagation()
    });

    // show/hide share buttons
    ['click', 'touchend'].map(function (evType) {
      document.getElementById('shareagain-share').addEventListener(evType, function (ev) {
        toggleShareButtons()
        ev.preventDefault()
        ev.stopPropagation()
      })
    })

    navbar.addEventListener('touchend', function (ev) {
      ev.preventDefault()
      ev.stopPropagation()
    })

    // copy slides link to clipboard
    const shareClip = new ClipboardJS('.shareon .link')
    shareClip.on('success', function (e) {
      const el = document.querySelector('.shareon .link')
      el.classList.add('success')
      setTimeout(() => el.classList.remove('success'), 2500)
    })

    slideshow.on('afterShowSlide', function (slide) {
      toggleSlideButtons(slide.getSlideIndex())
    })

    function toggleAnimated ({ selector, show, inClass, outClass }) {
      const el = document.querySelector(selector)
      const isShown = el.classList.contains(inClass)
      if (typeof show === 'undefined') {
        show = !isShown
      }
      if (show === isShown) {
        return
      }
      if (show) {
        el.classList.remove(outClass)
        el.classList.add(inClass)
      } else {
        el.classList.remove(inClass)
        el.classList.add(outClass)
      }
    }

    let isCurrentlyFullScreen = false
    document.addEventListener('fullscreenchange', (event) => {
      if (document.fullscreenElement) {
        stopAutoHide(false)
        isCurrentlyFullScreen = true
      } else {
        isCurrentlyFullScreen = false
        startAutoHide()
      }
    })

    function toggleNavBar (show) {
      // do nothing if currently fullscreen
      if (isCurrentlyFullScreen) return

      toggleAnimated({ selector: '.shareagain-bar ul', show, inClass: 'slideInUp', outClass: 'slideOutDown' })
      if (!show) toggleShareButtons(false)
    }

    function toggleShareButtons (show) {
      toggleAnimated({ selector: '.shareagain-bar .shareon', show, inClass: 'slideInRight', outClass: 'slideOutRight' })
    }

    // auto hide the share bar when focus is in the slides
    let mouseMoveTimer = null
    function hideNavDelayed (ev) {
      if (mouseMoveTimer) {
        clearTimeout(mouseMoveTimer)
      }
      toggleNavBar(true)
      mouseMoveTimer = setTimeout(function () { toggleNavBar(false) }, 2000)
    };

    // toggle toggle full screen
    ['click', 'touchend'].map(function (evType) {
      document.getElementById('shareagain-fullscreen').addEventListener(evType, function (ev) {
        slideshow.toggleFullscreen()
        ev.stopPropagation()
      })
    })

    function startAutoHide () {
      hideNavDelayed()
      slidesContainer.addEventListener('mousemove', hideNavDelayed)
    }

    function stopAutoHide (showAfter = false) {
      slidesContainer.removeEventListener('mousemove', hideNavDelayed)
      clearTimeout(mouseMoveTimer)
      toggleNavBar(showAfter)
    }

    // auto hide turns on when the mouse comes into the slides area
    slidesContainer.addEventListener('mouseenter', function () {
      startAutoHide()
    })

    // turn off auto hide when the mouse leaves the slides area
    slidesContainer.addEventListener('mouseleave', function () {
      stopAutoHide(true)
    });

    // turn off auto hide if the mouse or focus is in the share bar
    ['focusin', 'mouseenter'].map(function (evType) {
      navbar.addEventListener(evType, function () {
        stopAutoHide(true)
      })
    });

    // and turn auto hide back on whne the mouse leaves the share bar
    // (if mouse exits out of the slides area, the slidesContainer should fire later)
    ['focusout', 'mouseleave'].map(function (evType) {
      navbar.addEventListener(evType, function () {
        startAutoHide()
      })
    })
  }
})()
</script>

# [General hazard](https://datahazards.com/contents/hazards/general-hazard.html)

.pull-left[
![General Hazard logo](data:image/png;base64,#img/hazards/general-hazard.png)
]

--

.pull-right[
Issues:  

Misunderstanding/misinterpretation  
Errors, changes in methodology  
We don&#39;t know what happens to the request after its made.  

--

Precautions:  

Mitigate with a caveat of data changing?  
Issue corrections publicly?  
Share methodology and update it if changes? 
]

name: bias
class: hide-logo

# [Reinforce Existing bias](https://datahazards.com/contents/hazards/reinforces-biases.html)

.pull-left[
![Bias logo](data:image/png;base64,#img/hazards/reinforce-bias.png)

]

--

.pull-right[

Issues:  

Hard to say as the service wasn&#39;t mentioned in the scenario but could an incorrect number have been accepted because of bias?  

Could reusing it reinforce that bias?

--

Precautions:

Although the Freedom of Information related to one service, could this be extended to other services to see if there is bias between services and/or certain groups.
]

name: rank
class: hide-logo

# [Ranks or classifies people](https://datahazards.com/contents/hazards/ranks-classifies.html)

.pull-left[
![Ranks people logo](data:image/png;base64,#img/hazards/classifies-people.png)
]

--
.pull-right[

Issues:
Could the data also be requested of multiple Trusts to be compared now or could be in the future?

--

Precautions:
Publish the methodology and/or code for other Trusts to replicate or audit if required.
]

name: environment
class: hide-logo

# [High Environmental Cost](https://datahazards.com/contents/hazards/high-environmental-cost.html)

.pull-left[
![Environmental cost logo](data:image/png;base64,#img/hazards/environment.png)
]
--

.pull-right[
Issues:
Was it quick code to run or resource hungry?  

Is the data part of a larger data set that is replicated across Trusts (HES data for example) and needs big storage?

--

Precautions:
Code reviews to ensure code is not unnecessarily resource hungry. 
]

name: community
class: hide-logo

# [Lacks community involvement](https://datahazards.com/contents/hazards/lacks-community-involvement.html)

.pull-left[
![Lacks Community logo](data:image/png;base64,#img/hazards/lacks-community.png)
]
--

.pull-right[

Issues:
Generally these data requests are not checked with the community. But is that necessary?

Freedom of Information requests are also published by Trusts or public sites like [What do they Know](https://www.whatdotheyknow.com/) 

--

Precautions:
Could some Freedom of Information requests become analyses in their own right?  

For example, a question that highlights a data gap like smoking cessation used for patients who are under 16 in mental health services highlighted data on smoking status is poorly recorded. Could we escalate the poor data?
]

Perhaps a hazard for all Freedom of Information as we don&#39;t know what happens to the request. 

--

Precautions:
Could we mitigate by sharing and publishing methodology/code?
]

# More Ethics Resources

--

* Bristol University have a virtual [Data Ethics Club](https://dataethicsclub.com/)  

--

* Civil Service have an [awareness online course](https://gss.civilservice.gov.uk/training/awareness-in-data-ethics/)

--

* UK Statistics Authority have an [Ethics Self-Assessment Tool](https://uksa.statisticsauthority.gov.uk/the-authority-board/committees/national-statisticians-advisory-committees-and-panels/national-statisticians-data-ethics-advisory-committee/ethics-self-assessment-tool/)

--

* [Government Data Science Slack](govdatascience.slack.com) have an Ethics channel and 

--

[Data ethics and society reading group](https://github.com/alphagov/data-ethics-and-society-reading-group) for cross government sessions on books and articles relating to ethics in data science

# Scenario 2  

## Did not attend analysis

.pull-left[

Use [templates](#templates) to go through the Hazards

![Photo of a calendar with dates](data:image/png;base64,#img/pexels-pixabay-273153.jpg)

]

.pull-right[

Did not attends cost the NHS in money, lost opportunity and staff time. It&#39;s analysis that is asked of analysts/data scientist, particularly in view of demographics and population health management.  

The analysis question posed is: Are some groups more like to not attend than others? 

]

class: inverse

# Scenario 3  

## Dashboard analysis

.pull-left[

Use [templates](#templates) to go through the Hazards

![Photo of a laptop with graphs on the screen](data:image/png;base64,#img/pexels-lukas-577210.jpg)

]

.pull-right[

A dashboard is requested which needs to include demographics, service information and some time related information. It needs to be high level but possible to drill down to lower but not to actual patient data.

]
